    false,nt"url": null,nt"notes": "This map service displays the results data
    from the EPA's Environmental Quality Index. The US Environmental Protection Agency's
    (EPA) National Health and Environmental Effects Research Laboratory (NHEERL) in
    the Environmental Public Health Division (EPHD) is currently engaged in research
    aimed at developing a measure that estimates overall environmental quality at the
    county level for the United States. This work is being conducted as an effort to
    learn more about how various environmental factors simultaneously contribute to
    health disparities in low-income and minority populations, and to better estimate
    the total environmental and social context to which humans are exposed. This dataset
    contains the finalized Environmental Quality Index (EQI), and an index for each
    of the associated domains (air, water, land, built environment, and sociodemographic
    environment). Indices are at the county level for all counties in the United States.",nt"license_title":
